const GameTile = ({ page, description }: { page: GamePages; description?: string }) => {
  return (
    <div className={`${scssObj.baseClass}__item-container`}>
      <div className={`${scssObj.baseClass}__container-box`}>
        <Link linkStyle="container" to={page} target="new">
          <div className={`${scssObj.baseClass}__item`}>
            <div className={`${scssObj.baseClass}__details`}>
              <div className={`${scssObj.baseClass}__name`}>{PageTitles[page]}</div>
              {/* <div className={`${scssObj.baseClass}__info`}>
                {version} | {publisher} | Published {displayAge()} ago
              </div> */}
              {description && (
                <div className={`${scssObj.baseClass}__description`}>{description}</div>
              )}
            </div>
            <div className={`${scssObj.baseClass}__preview`}>{Previews[page]}</div>
            {/* <CopyField
            className={`${scssObj.baseClass}__install`}
            name="install"
            value={`npm i ${name}`}
          /> */}
            {/* <div className={`${scssObj.baseClass}__install`}>npm i {name}</div> */}
          </div>
        </Link>
      </div>
    </div>
  );
};

const Games = () => {
  return (
    <div className={`${scssObj.baseClass}`}>
      <Helmet>
        <title>Games</title>
      </Helmet>
      <div className={`${scssObj.baseClass}__games-list`}>
        {Object.values(GamePages).map((page) => {
          return <GameTile page={page} />;
        })}
      </div>
    </div>
  );
};

export default Games;
